import React, { useState } from 'react';
import Navbar from './Navbar';
import auctionData from '../data/AuctionData';

const HomePage = ({ userRole, handleLogout }) => {
  const [selectedAuction, setSelectedAuction] = useState(null);

  const handleSelectAuction = (item) => {
    setSelectedAuction(item);
  };

  return (
    <div className="bg-gradient-to-br from-gray-100 to-gray-300 min-h-screen">
      {/* Navbar */}
      <Navbar userRole={userRole} handleLogout={handleLogout} />

      <div className="container mx-auto px-4 py-8">
        <h2 className="text-4xl font-bold text-center text-gray-800 mb-10">
          Available Auctions
        </h2>

        {!selectedAuction ? (
          // Auction grid layout - 3x2 grid view
          <div className="grid grid-cols-1 md:grid-cols-3 gap-8">
            {auctionData.slice(0, 6).map((item) => (
              <AuctionCard
                key={item.id}
                item={item}
                onSelect={() => handleSelectAuction(item)}
              />
            ))}
          </div>
        ) : (
          // Selected auction detail view with image carousel
          <AuctionDetail auction={selectedAuction} onBack={() => setSelectedAuction(null)} />
        )}
      </div>
    </div>
  );
};

const AuctionCard = ({ item, onSelect }) => (
  <div
    className="bg-white shadow-lg rounded-lg overflow-hidden group cursor-pointer transform transition duration-300 hover:scale-105 hover:shadow-xl"
    onClick={onSelect}
  >
    <img
      src={item.images[0]} // Display the first image as a thumbnail
      alt={item.title}
      className="w-full h-64 object-cover transition-transform duration-300 group-hover:scale-110"
    />
    <div className="p-5">
      <h3 className="text-xl font-semibold text-gray-800">{item.title}</h3>
      <p className="text-gray-600 mt-2">{item.shortDescription}</p>
      <button className="mt-4 w-full bg-blue-500 text-white py-2 rounded-lg hover:bg-blue-600 transition duration-300 ease-in-out">
        View Auction
      </button>
    </div>
  </div>
);

const AuctionDetail = ({ auction, onBack }) => {
  const [currentImageIndex, setCurrentImageIndex] = useState(0);

  const handleNextImage = () => {
    setCurrentImageIndex((prevIndex) =>
      prevIndex === auction.images.length - 1 ? 0 : prevIndex + 1
    );
  };

  const handlePrevImage = () => {
    setCurrentImageIndex((prevIndex) =>
      prevIndex === 0 ? auction.images.length - 1 : prevIndex - 1
    );
  };

  return (
    <div className="bg-white shadow-2xl rounded-lg overflow-hidden max-w-3xl mx-auto mt-8 p-6">
      <button onClick={onBack} className="text-blue-500 text-sm hover:underline mb-4">
        &lt; Back to Auctions
      </button>
      <div className="relative">
        {/* Carousel for selected auction */}
        <img
          src={auction.images[currentImageIndex]}
          alt={auction.title}
          className="w-full h-96 object-cover rounded-lg"
        />
        <button
          onClick={handlePrevImage}
          className="absolute top-1/2 left-4 transform -translate-y-1/2 bg-gray-800 bg-opacity-70 text-white p-2 rounded-full focus:outline-none hover:bg-opacity-90 transition"
        >
          &lt;
        </button>
        <button
          onClick={handleNextImage}
          className="absolute top-1/2 right-4 transform -translate-y-1/2 bg-gray-800 bg-opacity-70 text-white p-2 rounded-full focus:outline-none hover:bg-opacity-90 transition"
        >
          &gt;
        </button>
      </div>
      <div className="p-6 text-gray-800">
        <h3 className="text-3xl font-bold mb-3">{auction.title}</h3>
        <p className="text-gray-700 mb-4">{auction.shortDescription}</p>
        <div className="flex justify-between items-center mt-6">
          <p className="text-gray-800 font-semibold text-lg">Current Bid: ${auction.currentBid}</p>
          <p className="text-gray-500 text-sm">Auction ends: {auction.endDate}</p>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
